import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, } from 'react-bootstrap';
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import Card from 'react-bootstrap/Card';
import Form from 'react-bootstrap/Form'
import '../componentes/style.css';


function Salasmod() {
  
  const { id } = useParams();
  const [sala, setFormData] = useState([]);
  
  useEffect(() => {
      async function fetchFormData () {
      
      try {
        
        console.log('id =' + id);
        const response = await axios.get(`http://localhost:2527/api/fndsalas/${id}`);
        setFormData(response.data);      
        console.log('response ' + response.data);
      } catch (error) {
        console.error(error);
      }
  
      };
      fetchFormData();
    },[id]); 
  
  return (    

    <Container fluid>

      <NavSc/>

      <Card>
        <Card.Img className='doriana' variant="top" src={sala.imgsala} />
      <Card.Body>
          <form>
            <div class="form">
              <div class="title">Welcome</div>
              <div class="subtitle">Let's create your account!</div>
              <div class="input-container ic1">
                <input id="firstname" class="input" type="text" placeholder="" value={sala.numero}/>
                <div class="cut"></div>
                <label for="firstname" class="placeholder">Numero</label>
              </div>
              <div class="input-container ic2">
                <input id="lastname" class="input" type="text" placeholder="" value={sala.descricao}/>
                <div class="cut"></div>
                <label for="lastname" class="placeholder">Last name</label>
              </div>
              <div class="input-container ic2">
                <input id="email" class="input" type="text" placeholder="" value={sala.capacidade}/>
                <div class="cut cut-short"></div>
                <label for="email" class="placeholder">Email</label>
              </div>
              <div class="input-container ic2">
                <input id="email" class="input" type="text" placeholder="" value={sala.imgsala}/>
                <div class="cut cut-short"></div>
                <label for="email" class="placeholder">Email</label>
              </div>
              <div class="input-container ic2">
                <input id="email" class="input" type="text" placeholder="" value={sala.valor}/>
                <div class="cut cut-short"></div>
                <label for="email" class="placeholder">Email</label>
              </div>
              <button type="text" class="submit">SALVAR</button>
            </div>
            </form>
      </Card.Body>
      </Card>
      <Bootfooter/>       

    </Container>
  );
}

export default Salasmod;
